import React, { useState, useEffect } from "react";
import { Table } from "antd";
import Widget from "components/Widget/index";

const columns = [
  {
    title: 'Transaction ID',
    dataIndex: 'currency',
  },
  {
    title: 'Merchant ID	',
    dataIndex: 'rate',
  },
  {
    title: 'DATE',
    dataIndex: 'date',
  },
  {
    title: 'FEE',
    dataIndex: 'fee',
    render: (text) => {
      return <span className="gx-text-red">{text}</span>
    },
  }
];

const data = [
  {
    key: '1',
    currency: '0.24 BTC',
    rate: '1 BTC = $740',
    date: '08.10.17',
    fee: '-$2.33'
  },
  {
    key: '2',
    currency: '0.34 RPL',
    rate: '1 RPL = $80.2',
    date: '08.03.17',
    fee: '-$1.23'
  },
  {
    key: '3',
    currency: '0.24 BTC',
    rate: '1 BTC = $740',
    date: '07.29.17',
    fee: '-$3.22'
  },
  {
    key: '4',
    currency: '0.22 BTC',
    rate: '1 BTC = $740',
    date: '07.28.17',
    fee: '-$3.22'
  },
  {
    key: '5',
    currency: '0.74 LTE',
    rate: '1 LTE = $99',
    date: '05.22.17',
    fee: '-$2.21'
  }
];

const LatestTransaction = () => {
  const [latestTransaction, setLatestTransaction] = useState([])
  console.log("latestTransaction", latestTransaction)
  useEffect(() => {
    getLatestTransaction();
  }, []);
  const QQQ = localStorage.getItem("token")
  console.log("QQQ", QQQ)
  // let body={"startdate":start,"enddate":end}
  // let headers={"x-api-key":this.tokenService.getUser()['api-key']}
  // return this.http.post<any>(DATA_API+'orders',body,{headers})
  // TOKEN LOCAL STORAGE
  const getLatestTransaction = async () => {
    try {
      const response = await fetch(
        process.env.REACT_APP_URL + "/latestorder",
        {
          method: "GET",
          headers: {
            "Content-Type": "application/json",
            Authorization: localStorage.getItem("token"),
          },
        }
      );
      let res = await response.json();
      // console.warn(xhr.responseText)
      console.log("resresres", res);
      setLatestTransaction(res);
    } catch (err) {
      console.log(err.message);
    }
  };
  return (
    <Widget styleName="gx-order-history"
      title={
        <h2 className="h4 gx-text-capitalize gx-mb-0">
          Order History</h2>
      } extra={
        <p className="gx-text-primary gx-mb-0 gx-pointer">Detailed History</p>
      }>
      <div className="gx-table-responsive">
        <Table className="gx-table-no-bordered" columns={columns} dataSource={data} pagination={false} bordered={false}
          size="small" />
      </div>
    </Widget>
  );
};

export default LatestTransaction;
